import React from 'react';
import styled from 'styled-components';
import Row from 'react-bootstrap/Row'
import Container from 'react-bootstrap/Container'
import {PostJumbotron} from './../components/PostJumbotron';
import {Footer} from './../components/Footer';


const Styles = styled.div`
    .row {
        margin-left: 0px;
        margin-right: 0px;
        font-family: 'Montserrat', sans-serif;
    }

    .col {
        text-align: center;
    }
`;

const PStyled = styled.p`
    font-size: 16px !important;
    margin-bottom: 20px;
`;


export const Quadratic = () => {
    return (
        <Styles>
            <PostJumbotron 
                date = 'October 10th, 2019'
                title = 'What I Learned About Life From Buying a Goat on Craigslist'
                subTitle = 'One goat became two, then a whole farm, then a crash course in what really matters'>
            </PostJumbotron>
            <Container style = {{paddingTop: 30, paddingBottom: 70, paddingLeft: 120, paddingRight: 120}}>
                <PStyled>Po-Shen Loh is a math enthusiast and evangelist. 
                    He is the national coach of the USA International 
                    Mathematical Olympiad team, a math professor at 
                    Carnegie Mellon University, and the founder of the
                    social enterprise expii.com, an education technology
                    startup providing a free personalized learning 
                    platform on every smartphone.
                </PStyled>
            </Container>
            <Footer></Footer>
        </Styles>
    );
}
